import React from 'react';

class What extends React.Component {
    constructor (props) {
        super(props);

        };

        render() {
            return (
                <div id="whatContainer">
                    <div id="whatImg">
                        
                    </div>

                    <div id="whatContent">
                    <strong><u>Who are we?</u></strong><br />
                        This here is what we do. We will most likely have one or two sentences explaining our business.
                    </div>


                    <style jsx>
                        {`

                        #whatContainer {
                            height: 100%;
                            width: 200px;
                        }

                        #whatImg {
                            height: 150px;
                            width: 150px;
                            background-color: red;
                            margin: auto;
                            border-radius: 50%;
                        }

                        #whatContent {
                            color: white;
                        }
                        
                        `}
                    </style>
                </div>
            )
        }
    }

export default What;
